import React from 'react';
import '../App.css';
import { SectionsContainer, Section } from 'react-fullpage';
import styled from 'styled-components';
import { Container1,Container2 } from '../StyleComponents/StyleComponent';
function Layout(props) {

    let options = {
        anchors: ['sectionOne', 'sectionTwo', 'sectionThree'],
        navigation: false,
        delay: 1000,
    };


    return (
        <SectionsContainer {...options}>
            <Section>
                <Container1>
                    <h1>이상혁</h1>
                </Container1>
            </Section>

            <Section>
                <Container2>
                    <h1>내용</h1>
                </Container2>
            </Section>

            <Section>
                Page 3
            </Section>
        </SectionsContainer>
    );
}

export default Layout;
